import App from "../../App";
import WebSite from "../_webSite/WebSite";
import WebSiteTasks from "../WebSiteTasks/WebSiteTasks";

import React from "react";
import { Link, Route, BrowserRouter as Router } from "react-router-dom";

export const routes = [
  {
    path: "/",
    exact: true,
    sidebar: null,
    component: App
  },
  {
    path: "/website",
    sidebar: (
      <ul>
        <li>
          <Link to="/websiteinfo">Web Site Info</Link>
        </li>
        <li>
          <Link to="/credentials">Credentials</Link>
        </li>
        <li>
          <Link to="/status">Status</Link>
        </li>
      </ul>
    )
  },
  {
    path: "/tasks",
    sidebar: (
      <ul>
        <li>
          <Link>Taks Link 2</Link>
        </li>
        <li>
          <Link to="/taskLink">Another Taks Link</Link>
        </li>
      </ul>
    )
  },
  {
    path: "/tasks",
    sidebar: (
      <ul>
        <li>
          <Link>Taks Link 2</Link>
        </li>
        <li>
          <Link to="/taskLink">Another Taks Link</Link>
        </li>
      </ul>
    )
  }
];

export default {
  routes
};
